    [],nt"revision_timestamp": "2016-07-27T22:45:19.560307",nt"name": "crab-orchard-national-wildlife-refuge-narrative-report-january-thru-april-1959",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crab Orchard
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1959. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and wildfires. Resource management is outlined;
    topics include grazing, haying, timber removal, and commercial fishing. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, and violations. Items of interest, N-R forms, and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
